export const bubble = require("..assets/icons/bubble.png");
export const clothesW = require("..assets/icons/clothes washing.png");
export const clothes = require("..assets/icons/clothes.png");
export const customer = require("..assets/icons/customer.png");
export const foam = require("..assets/icons/foam bubbles.png");
export const maps = require("..assets/icons/maps.png");
export const messages = require("..assets/icons/message.png");
export const phone = require("..assets/icons/phone.png");
export const warmw = require("..assets/icons/warm washing.png");
export const wmachine = require("..assets/icons/wmachine.png");


export default {
    bubble,
    clothesW,
    clothes,
    customer,
    foam,
    maps,
    messages,
    phone,
    warmw,
    wmachine,
}
